                             Bootstrap theme



**************************************************************************/
/* Navigation */
.navbar {
  background: #fff;
  margin-bottom: 0;
  border-bottom: 0 none;
  box-shadow: 0 2px 3px rgba(0, 0, 0, 0.3);
}
.navbar.ontop-now {
  box-shadow: none;
  background: transparent;
  border-bottom: 1px solid #d9dee2;
}
.navbar.no-border {
  border-bottom: 0 none;
}
.navbar .navbar-toggle {
  border-color: transparent;
  background: transparent;
  border-radius: 3px;
}
.navbar .navbar-toggle:hover {
  background: transparent;
  border-color: transparent;
}
.navbar .navbar-toggle .icon-bar {
  background: #333;
}
@media (max-width: 480px) {
  .navbar .navbar-collapse.collapse.in {
    background: #fff;
  }
}
.navbar .navbar-nav {
  font-family: "Open sans", helvetica, "Helvetica Neue", arial;
}
.navbar .navbar-nav > li > a {
  text-transform: uppercase;
  font-weight: bold;
  font-size: 13px;
}
.navbar .navbar-nav > li > a,
.navbar .navbar-nav > .open ul > a {
  color: #4d4d4d;
  background: none;
}
.navbar .navbar-nav > li > a:hover,
.navbar .navbar-nav > li > a:focus,
.navbar .navbar-nav > .open > a:hover,
.navbar .navbar-nav > .open > a:focus,
.navbar .navbar-nav > .active > a {
  background: none;
  color: #DA4453;
}
.navbar .navbar-nav .dropdown-menu {
  font-size: 13px;
  border-radius: 0px;
  -webkit-box-shadow: 0 6px 12px rgba(0, 0, 0, 0.175);
  box-shadow: 0 6px 12px rgba(0, 0, 0, 0.175);
}
.navbar .navbar-nav .dropdown-menu > li > a {
  color: #333;
  padding: 7px 20px;
}
.navbar .navbar-nav .dropdown-menu > li > a:hover,
.navbar .navbar-nav .dropdown-menu > li > a:focus,
.navbar .navbar-nav .dropdown-menu > .active > a:hover,
.navbar .navbar-nav .dropdown-menu > .active > a,
.navbar .navbar-nav .dropdown-menu > .active > a:focus {
  background: none;
  color: #DA4453;
}
.navbar .navbar-brand {
  font-family: "Open sans", helvetica, arial;
  font-size: 24px;
  color: #333;
  padding: 0 0 0 15px;
  margin: 12px 0 0 0;
  height: auto;
}
.navbar .navbar-brand img {
  margin-top: -8px;
}
.navbar .navbar-brand img {
  display: none;
}
.navbar .navbar-brand img.secondary {
  display: block;
}
.navbar-inverse {
  background: #1C2A42;
  border-radius: 0;
  border-bottom: 0 none;
  box-shadow: none;
}
.navbar-inverse.ontop-now {
  border-bottom: 0 none;
}
.navbar-inverse.headroom.ontop-now {
  background: transparent;
  border-bottom: 0 none;
}
.navbar-inverse .navbar-toggle {
  border-color: transparent;
  background: transparent;
}
.navbar-inverse .navbar-toggle:hover {
  background: rgba(255, 255, 255, 0.25);
}
.navbar-inverse .navbar-toggle .icon-bar {
  background: #f0f0f0;
  opacity: .75;
}
.navbar-inverse *:focus {
  outline: 0;
}
@media (max-width: 767px) {
  .navbar-inverse {
    background: rgba(0, 0, 0, 0.9);
  }
}
@media (max-width: 480px) {
  .navbar-inverse .navbar-collapse.collapse.in {
    background: #1C2A42;
  }
}
.navbar-inverse .navbar-nav > li > a,
.navbar-inverse .navbar-nav > .open ul > a {
  color: rgba(255, 255, 255, 0.7);
}
.navbar-inverse .navbar-nav > .active > a,
.navbar-inverse .navbar-nav > .active > a:hover,
.navbar-inverse .navbar-nav > .active > a:focus {
  color: #fff;
  background: none ;
}
.navbar-inverse .navbar-nav > .open > a {
  background: none;
  color: white;
}
.navbar-inverse .navbar-nav > li > a:hover,
.navbar-inverse .navbar-nav > li > a:focus,
.navbar-inverse .navbar-nav > .open > a:hover,
.navbar-inverse .navbar-nav > .open > a:focus {
  background: none;
  color: white;
}
.navbar-inverse .navbar-nav > .active > a {
  background: none;
  color: white;
}
