		> .dropdown.open .dropdown-toggle{ }

		> li > a:hover,
		> li > a:focus,
		> .open > a:hover,
		> .open > a:focus,
		> .active > a { background:none; color:@color-action; }

		.dropdown-menu {
			font-size: 13px; border-radius: 0px; -webkit-box-shadow: 0 6px 12px rgba(0, 0, 0, 0.175); box-shadow: 0 6px 12px rgba(0, 0, 0, 0.175);
