			> .active > a:focus { background: none; color:@color-action; }
		}
	}

	.navbar-brand {
		font-family: "Open sans", helvetica, arial; font-size: 24px; color:@color-text; padding:0 0 0 15px; margin:12px 0 0 0; height:auto;
