	background: @bg-head; border-radius: 0; border-bottom: 0 none; box-shadow: none;
	&.ontop-now { border-bottom: 0 none; }
	&.headroom.ontop-now { background:transparent; border-bottom: 0 none; }

	.navbar-toggle {
		border-color:transparent; background:transparent;
		&:hover { background:rgba(255,255,255,.25);}
